import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';

const SignedInLinks = () => {
    return (
        <Nav className="ml-auto" navbar>
            <NavItem><Link  tag={Link} to='/'>Felhasználók</Link></NavItem>
            <NavItem><NavLink tag={Link} to='../dashboard/Dashboard'>Statisztika</NavLink></NavItem>
            <NavItem><NavLink tag={Link} to='/'>Jegytípusok</NavLink></NavItem>
        </Nav>
    )
}

export default SignedInLinks;
